sys_variable_value.value:
(function execute(inputs, outputs) {


  	try {
		var actioninputs = {};
		actioninputs['ws1incidentnumber'] = inputs.incidentnumber; // String 

		// Start Asynchronously: Uncomment to run in background. Code snippet will not have access to outputs.
		// sn_fd.FlowAPI.getRunner().subflow('x_vmw_ws1uem.ws1uemactionsubflow').inBackground().withInputs(inputs).run();

		// Execute Synchronously: Run in foreground. Code snippet has access to outputs.
		var result = sn_fd.FlowAPI.getRunner().subflow('x_vmw_ws1uem.ws1uemactionsubflow').inForeground().withInputs(actioninputs).run();
		var actionoutputs = result.getOutputs();

		outputs.ws1errorstate = false;	
	} catch (ex) {
		var message = ex.getMessage();      
		gs.error(message);
      	outputs.ws1errorstate = true;	

	}


})(inputs, outputs);

